// src/components/common/MusicTile.tsx
import React from 'react';

const MusicTile: React.FC = (props) => {
  const tileStyle: React.CSSProperties = {
    border: '1px solid #ccc',
    borderRadius: '8px',
    padding: '16px',
    margin: '16px',
    textAlign: 'center',
  };

  const titleStyle: React.CSSProperties = {
    fontSize: '1.5em',
    color: '#333',
  };

  const artistStyle: React.CSSProperties = {
    fontSize: '1.2em',
    color: '#666',
  };

  return (
    <div style={tileStyle}>
      <h2 style={titleStyle}>Song Title</h2>
      <p style={artistStyle}>Artist Name</p>
    </div>
  );
};

export default MusicTile;
